import React, {useState} from 'react';
import AddUser from './components/Users/AddUser';
import UserList from './components/Users/UsersList';

function App() {
  const[usersList, setUsersList] = useState([]);
  return (
    <div>
      <AddUser />
      <UserList users={usersList}/>
    </div>
  );
}

export default App;
